import React from "react";

function Dashboard() {
  return (
    <div style={{ overflow: "hidden" }}>
      <div
        style={{
          height: "30vh",
          width: "30vw",
          backgroundColor: "green",
          overflow: "hidden",
        }}
      ></div>
    </div>
  );
}

export default Dashboard;
